import { createAction } from "@reduxjs/toolkit";

export const ATHANTICATION = createAction("ATHANTICATION");
export const LOGINUSERDATA = createAction("LOGINUSERDATA");
export const CARDDATA = createAction("CARDDATA");
export const WISHLISTDATA = createAction("WISHLISTDATA");
